import { NavDiv, Logo, MenuDiv } from "./styled"

const Navbar = () => {
    return (
        <NavDiv>
            <Logo />
            <MenuDiv>
                <a href="#">Dimitri</a>
                <a href="#">Teste</a>
            </MenuDiv>
        </NavDiv>
    )
}

export default Navbar
